function withdrawEarnings() public {
    address sender = msg.sender;

    // Ensure the lock time for the sender has passed
    require(block.timestamp > lockTime[sender], "Earnings are still locked");

    // Calculate the total earnings for the sender
    uint256 totalEarnings = (stakes[sender] * dailyROI) / 1000;

    // Ensure the total earnings calculation is valid
    require(totalEarnings > 0, "No earnings available");

    // Update the lock time for the sender
    lockTime[sender] = block.timestamp + 1 days;

    // Transfer the earnings to the sender
    require(IERC20(momo_token).transfer(sender, totalEarnings), "Transfer failed");

    // Emit the withdrawal event
    emit OnWithdrawal(sender, totalEarnings);
}

